import React from "react";
import PropTypes from "prop-types";

import Header from "../../components/Header";
import MobileForm from "./components/MobileForm";
import DesktopForm from "./components/DesktopForm";

function View({ width, openInput, onSelectFile, logout, signed, update }) {
  return (
    <>
      <Header />
      {width < 1200 ? (
        <MobileForm
          openInput={openInput}
          onSelectFile={onSelectFile}
          logout={logout}
          signed={signed}
          update={update}
          username={username}
          name={name}
          email={email}
          password={password}
        />
      ) : (
        <DesktopForm
          openInput={openInput}
          onSelectFile={onSelectFile}
          logout={logout}
          signed={signed}
          update={update}
          username={username}
          name={name}
          email={email}
          password={password}
        />
      )}
    </>
  );
}

View.propTypes = {
  width: PropTypes.number,
  openInput: PropTypes.func,
  onSelectFile: PropTypes.func,
  logout: PropTypes.func,
  signed: PropTypes.bool,
  update: PropTypes.func,
};

View.defaultProps = {
  width: window.innerWidth,
  openInput: () => {},
  onSelectFile: () => {},
  logout: () => {},
  signed: false,
  update: () => {},
};

export default View;
